import React, { useState } from 'react';
import {
  IonContent,
  IonHeader,
  IonList,
  IonPage,
  IonRefresher,
  IonRefresherContent,
  IonTitle,
  IonToolbar,
  useIonViewWillEnter,
  IonCard,
  IonItem,
  IonThumbnail,
  IonCardHeader,
  IonCardContent,
  IonIcon
} from '@ionic/react';
import './Contact.css';

const Contact: React.FC = () => {



  return (
    <IonPage id="Contact">
      <IonHeader>
        <IonToolbar>
          <IonTitle>Contact</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonCard>
          <IonItem>
            <IonIcon item-start></IonIcon>
              <h3>UK Call</h3>

              <p>+44 121 410 6000</p>
            </IonItem>
        </IonCard>

      </IonContent>
    </IonPage>
  );
};

export default Contact;
